import React from "react";
import "./Login.css";
import logo from "./assets/images/austria.png";
import key from "./assets/images/logo_key_white.png";
// import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
// import {
//   faChalkboardTeacher,
//   faUser,
//   faBook,
//   faQuoteLeft,
//   faQuoteRight,
// } from "@fortawesome/free-solid-svg-icons";

class Login extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      email: "",
      password: "",
    };

    this.handleInputChange = this.handleInputChange.bind(this);
  }

  handleInputChange(event) {
    const target = event.target;
    const value = target.value;
    const name = target.name;

    this.setState({
      [name]: value,
    });
  }

  render() {
    return (
      <div className="Login">
        <main>
          <a href="/" className="logo-link">
            <img src={logo} className="logo" alt="logo" />
          </a>
          <section className="card">
            <h1>Login</h1>
            <img src={key} className="key" alt="key" />
            <form>
              <label for="email">Email</label>
              <input type="email" id="email" name="email" />
              <label for="password">Password</label>
              <input type="password" id="password" name="password" />
              <button type="submit">Login</button>
            </form>
            <p className="sign-up">
              Don't have an account? <a href="/">Sign Up</a>
            </p>
            <a href="/">Forgot Password</a>
          </section>
          {/* <section className="testimonials_signup">
          <div className="testimonials">
            <FontAwesomeIcon icon={faQuoteRight} className="quote_right" />
            <FontAwesomeIcon icon={faQuoteLeft} className="quote_left" />
          </div>
          <div className="signup">
            <h3>Sign Up Here for Help with Your Applications</h3>
            <p>
              To find out more about how Project Access can help you, we only
              ask for your first name and your email address to send you more
              information. Just fill out the form below and we will get in
              touch!
            </p>
            <form>
              <label for="name">First and Last Name</label>
              <input className="name" id="name" />
              <label for="email">Email</label>
              <input className="email" id="email" />
              <button type="submit">Register</button>
            </form>
          </div>
        </section> */}
        </main>
      </div>
    );
  }
}

export default Login;
